import React from "react";
import "./style.css";
import chandra_mohan from '../images/avtar.png';


function Myheader() {
  return (
    <div>
       <div className="navbar">
        <div className="logo">
        <img src={chandra_mohan} alt=""/>
        </div>

        <ul>
        <li>Home</li>
        <li>About Us</li>
        <li>Blog</li>
        <li>Contact Us</li>
        </ul>


       </div>


    </div>
  );
}

export default Myheader;
